import React from 'react';
import './donor-menu.css';
import { FaUser } from "react-icons/fa6/index.esm.js";
import {

  CDBSidebarMenu,
  CDBSidebarMenuItem,
} from 'cdbreact';
import { NavLink } from 'react-router-dom';
import  {SiBuzzfeed}  from "react-icons/si/index.esm.js";


const DonorMenu = () =>{
  return (
    <div>
      <CDBSidebarMenu>
            <NavLink exact to="/" activeClassName="activeClicked">
              <CDBSidebarMenuItem className='text-warning'><SiBuzzfeed className='primary'/>Feed</CDBSidebarMenuItem>
            </NavLink>
            <NavLink exact to="/tables" activeClassName="activeClicked">
              <CDBSidebarMenuItem ><FaUser/>Profile</CDBSidebarMenuItem>
            </NavLink>
            <NavLink exact to="/profile" activeClassName="activeClicked">
              <CDBSidebarMenuItem>Notifications</CDBSidebarMenuItem>
            </NavLink>
            <NavLink exact to="/analytics" activeClassName="activeClicked">
              <CDBSidebarMenuItem >Transactions</CDBSidebarMenuItem>
            </NavLink>

            <NavLink exact to="/hero404"  activeClassName="activeClicked">
              <CDBSidebarMenuItem >Support</CDBSidebarMenuItem>
            </NavLink>
            <NavLink exact to="/hero404"  activeClassName="activeClicked">
              <CDBSidebarMenuItem >Logout</CDBSidebarMenuItem>
            </NavLink>
          </CDBSidebarMenu>
    </div>
  )
}

export default DonorMenu
